import { StyleSheet } from "react-native";
import theme from "./theme";

const dayWorkoutStyles = StyleSheet.create({
    dateNavigation: {
        flex: 1,
        justifyContent: "space-between",
        color: theme.fontColor1,
        flexDirection: "row",
        alignItems: "center"
    },
    dateNavigationText: {
        color: theme.fontColor1,
        fontSize: 16
    },
    addExerciseButtonContainer: {
        marginTop: 30,
    },
    addExerciseButton: {
        flexDirection: "row",
        backgroundColor: theme.primary1,
        borderRadius: 5,
        paddingVertical: 5,
        paddingHorizontal: 15,
        alignItems: "center"
    },
    addExerciseButtonText: {
        color: theme.fontColor1,
        marginLeft: 10,
        fontSize: 16
    },
    exerciseCard: {
        marginTop: 30,
        backgroundColor: theme.background2,
        fontSize: 16,
        borderRadius: 5
    },
    exerciseCardTitleContainer: {
        borderBottomWidth: 1,
        borderBottomColor: theme.primary1,
        paddingVertical: 5,
        paddingHorizontal: 15,
        flex: 1,
        flexDirection: "row",
        justifyContent: "space-between",
        alignItems: "center"
    },
    exerciseCardTitle: {
        color: theme.fontColor1,
        fontSize: 20
    }
});

const exerciseStyles = StyleSheet.create({
    title: {
        textAlign: "center",
        fontSize: 20,
        color: theme.fontColor1,
        marginBottom: 15,
        borderBottomWidth: 2,
        borderBottomColor: theme.primary1,
        padding: 10
    },
    numberInput: {
        flexDirection: "row",
        justifyContent: "space-around",
        alignItems: "center"
    },
    serie: {
        borderBottomWidth: 1,
        borderBottomColor: theme.primary1
    }
});

const calendarStyles = StyleSheet.create({
    navigation: {
        flex: 1,
        flexDirection: "row",
        justifyContent: "space-between",
        alignItems: "center",
        marginBottom: 5
    },
    title: {
        color: theme.fontColor1,
        fontSize: 16
    },
    greenPoint: {
        backgroundColor: "#1c4d0f"
    }
});

export {
    dayWorkoutStyles,
    exerciseStyles,
    calendarStyles
};
